import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route, Switch } from 'react-router-dom';
import PropTypes from 'prop-types';
import Login from './pages/Login';
import RecipesMeals from './pages/RecipesMeals';
import RecipesDrinks from './pages/RecipesDrinks';
import Favorites from './pages/Favorites';
import Profile from './pages/Profile';
import RecipeInProgressMeals from './pages/RecipeInProgressMeals';
import RecipeInProgressDrink from './pages/RecipeInProgressDrink';
import RecipesDetailsMeals from './pages/RecipesDetailsMeals';
import RecipesDetailsDrink from './pages/RecipesDetailsDrink';
import DoneRecipes from './pages/DoneRecipes';

function App({ history }) {
  return (
    <Switch>
      <Route
        exact
        path="/"
        render={ () => Login(history) }
      />

      <Route
        exact
        path="/meals"
        component={ RecipesMeals }
      />

      <Route
        exact
        path="/drinks"
        component={ RecipesDrinks }
      />

      <Route
        exact
        path="/favorite-recipes"
        component={ Favorites }
      />

      <Route
        exact
        path="/profile"
        component={ Profile }
      />

      <Route
        exact
        path="/meals/:id-da-receita/in-progress"
        component={ RecipeInProgressMeals }
      />

      <Route
        exact
        path="/drinks/:id-da-receita/in-progress"
        component={ RecipeInProgressDrink }
      />

      <Route
        exact
        path="/meals/:id-da-receita"
        component={ RecipesDetailsMeals }
      />

      <Route
        exact
        path="/drinks/:id-da-receita"
        component={ RecipesDetailsDrink }
      />

      <Route
        exact
        path="/done-recipes"
        component={ DoneRecipes }
      />
    </Switch>
  );
}

App.propTypes = {
  history: PropTypes.shape({}),
}.isRequired;

export default App;
